import React from "react";



class LoggedInForm extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className='logged-div'>
        <header style='style-header'>You are logged in!</header>
      </div>
    )
  }
}

export default LoggedInForm;
